import NewRelData from "./NewRelData";
import MenData from "./MenData";
import WomenData from "./WomenData";
import KidsData from "./KidsData";

const NavList = [
  {
    id: 1,
    categoryTitle: "NEW RELLEASES",
    data: NewRelData,
  },
  {
    id: 1,
    categoryTitle: "MEN",
    data: "MenData",
  },
  {
    id: 1,
    categoryTitle: "WOMEN",
    data: "WomenData",
  },
  {
    id: 1,
    categoryTitle: "KIDS",
    data: "KidsData",
  },
];

export default NavList;
